// src/components/NavbarPage.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Logo from "./img/Logo.png";


const NavbarPage = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="bg-purple-900 md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 fixed w-full top-0 z-10">
        <div className="container mx-auto flex flex-col md:flex-row md:justify-between md:items-center">
          <div className="flex justify-between items-center w-full md:w-auto">
            <img className="object-cover" src={Logo} alt="Profile" />
            <button
              onClick={toggleDropdown}
              className="md:hidden text-yellow-500 hover:text-orange-600 focus:outline-none"
            >
              â˜°
            </button>
          </div>
          <ul
            className={`md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 ${
              isOpen ? "block" : "hidden"
            }`}
          >
            <li>
              <Link
                to="/home"
                className="text-black m-2 hover:text-orange-600 font-blond text-lg"
              >
                Home
              </Link>
            </li>
            <li>
              <Link
                to="/profile"
                className="text-black hover:text-orange-600 m-2 font-blond text-lg"
              >
                Profile
              </Link>
            </li>
            <li>
              <Link
                to="/about"
                className="text-black hover:text-orange-600 m-2 font-blond text-lg"
              >
                About
              </Link>
            </li>
            <li>
              <Link
                to="/contact"
                className="text-black hover:text-orange-600 m-2 font-blond text-lg"
              >
                Contact
              </Link>
            </li>
          </ul>
        </div>
      </nav>
  );
};

export default NavbarPage;
